import React from "react";

class Carousel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
        {
          id: 0,
          title: "",
          subTitle: "",
          imgSrc: "",
          link: "",
          selected: false,
        },
        {
          id: 1,
          title: "",
          subTitle: "",
          imgSrc: "",
          link: "",
          selected: false,
        },
        {
          id: 2,
          title: "",
          subTitle: "",
          imgSrc: "",
          link: "",
          selected: false,
        },
      ],
    };
  }

  render() {
    return <p>Carousel Works!</p>;
  }
}

export default Carousel;
